//Actions

//increment action
export const increment = (data) => {
  return {
    type: "INCREMENT",
    payload: data,
  };
};
//decrement action
export const decrement = () => {
  return {
    type: "DECREMENT",
  };
};

//increment action
export const signin = () => {
  return {
    type: "SIGN_IN",
  };
};
//decrement action
export const signout = () => {
  return {
    type: "SIGN_OUT",
  };
};
